import React from 'react';
import Card from 'react-bootstrap/Card';
import Form from 'react-bootstrap/Form';
import Checkbox from './Checkbox';

export default class SeniorDesign extends React.Component {
  render() {
    return (
      <Card style={{backgroundColor: 'var(--senior-design)', border: 'none', padding: '1rem'}}>
        <h4>Senior Design</h4>
          <Form>
            <div key={'default-checkbox'}>
              <Form.Check type='checkbox' label='Meet with advisor'/>
              <Form.Check type='checkbox' label='Meet with potential customers'/>
              <Form.Check type='checkbox' label='Implement!'/>
              <Form.Check type='checkbox' label='Presentation in class'/>
            </div>
          </Form>
      </Card>
    );
  }
}
